        mHdltvinHandle << " , " <<  " \"s_axi_man_ARADDR\" :  \"" << s_axi_man_ARADDR.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"s_axi_man_RVALID\" :  \"" << s_axi_man_RVALID.read() << "\" ";
